import React from "react";
import ContactOneForm from "./ContactOneForm";
import ContactOneInfoItem from "./ContactOneInfoItem";

const ContactOne = () => {
  const info_items = [
    {
      icon: "fa-envelope",
      content: (
        <>
          contato@citechnology.com.br
        </>
      ),
    },
    {
      icon: "fa-phone",
      content: (
        <>
          (61) 98346-3082
        </>
      ),
    },
    <><button onClick={handleSelectAddress}>
      <i className="fas fa-map-marker-alt" />
      <span>
        Localização: <br />
        Quadra 702, loja 46 <br />
        Asa Norte
      </span>
      <span>
        Localização 2: <br />
        Quadra 702, loja 46 <br />
        Asa Norte
      </span>
    </button><iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d239.9651231488373!2d-47.88956663080488!3d-15.780632702689656!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x935a3b43afab0b8d%3A0x8f08959e0689406a!2sSeven%20Tecnologia!5e0!3m2!1spt-BR!2sbr!4v1684944143243!5m2!1spt-BR!2sbr" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe></>
  ];

  return (
    <section id="contact" className="contact-area pt-70 pb-110">
      <div className="container">
        {/* section title */}
        <div className="row justify-content-center">
          <div className="col-lg-8">
            <div className="section-title text-center mb-70">
              <span className="sub-title">Contato</span>
              <h2 className="title">
                <span>Fale</span> conosco
              </h2>
            </div>
          </div>
        </div>

        {/* secction info */}
        <div className="contact-info-wrap">
          <div className="row justify-content-center">
            {info_items.map((x, index) => (
              <div key={index} className="col-lg-4 col-sm-6">
                <ContactOneInfoItem item={x} />
              </div>
            ))}
          </div>
        </div>

        {/* section form */}
        <ContactOneForm />
      </div>
    </section>
  );
};

export default ContactOne;
